function getWaveform(type, phase) {
    switch(type) {
    case 0:
	var cycles = phase/(2 * pi);
	var fracCycles = cycles - Math.floor(cycles);
	if(fracCycles < 0.25) {
	    return fracCycles * 4;
	}
	else if(fracCycles < 0.75) {
	    return 1 - ((fracCycles - 0.25) * 4);
	}
	else {
	    return (fracCycles - 1) * 4;
	}
    case 4:
	return Math.sin(phase);
    }


	return Math.sin(phase);
	//    return 0;
}

